class ToggleLike{constructor(e){let t=e;this.toggleLike(t)}toggleLike(e){$(e).click((t=>{t.preventDefault();var a=$(e).data("id");$.ajax({type:"get",url:$(e).attr("href"),data:{id:$(e).data("id"),type:$(e).data("type")}}).done((function(e){let t;t=e.data.deleted?notification("Unliked Successfully","success"):notification("Liked Successfully","success"),$(`#like-${a}`).html(e.data.likes),$("#flash-message").append(t)})).fail((function(e){let t=notification("Post Not Able To Like","error");$("#flash-message").append(t),console.log("Error in Liking",e)}))}))}}